import BullContainer from "./BullContainer";

import {useState, useEffect} from 'react'

const BullRow = (props) => {


    useEffect(() => {
        if (openApp == false) {
          setTimeout(() => {
            setOpenApp(true);
          }, 500);
        }
      }, [openApp]);

    return(
        <div className="upper-row" style={props.openApp ? {width: '25%'} : {width: '50%'}}>
           {props.upperStocks.map(data =>
               <BullContainer openApp={props.openApp} toggleActiveUpper={props.toggleActiveUpper} key={data.id} data={data}/>
               )}    
        </div>
    )
}

export default BullRow;
